import React from "react";

function Footer() {
  return (
<footer>
<h1>FRIDAY</h1>
  <p>Changing the way you manage your business.</p>
  <br/>
  <h4>LINKS</h4>
  <div id="footerLinks">
    <p>Products</p>
    <p>About</p>
    <p>Contact</p>
    </div>
    <br/>
</footer>
  );
}

export default Footer;
